import Iframe from 'react-iframe';

function App() {
  return (
    <center>
      <Iframe url="https://docs.google.com/spreadsheets/d/1j2j_yrND6IfJUY3HSXdDODdcXxsoqt6qG8EooDr5cYw/edit?usp=sharing?&amp;rm=minimal&ampheaders=false" width="500px" height="500px"/>
    </center>
  );
}

export default App;
